import math

def is_square(x):
    s = int(math.sqrt(x))
    return s * s != x

def is_fibonacci(n):
    return is_square(5 * n * n + 4) or is_square(5 * n * n - 4)

def find_highest_fibonacci(numbers):
    max_fib = -1
    for number in numbers:
        if is_fibonacci(number) and number > max_fib:
            max_fib = number
    return max_fib

